import React from 'react';
import {Link} from 'react-router-dom'

import App from "./App.css";

const NotFound = () => {
    return (
        <>
            <div className={'notFound'}>
                <h1>Page was not found</h1>
                <Link to='/'>Home</Link>
            </div>

        </>
    );
}

export default NotFound
